task:
Сколькими способами можно разместить семь бусин различных цветов на показанной гексагональной сетке, если расположения, получаемые отражениями и поворотами, считаются эквивалентными?

[asy]
size(50);
dot((0,0));
dot((1,0));
dot((-1,0));
dot((.5,sqrt(3)/2))oneDNN;
dot((.5,-sqrt(3)/2));
dot((-.5,sqrt(3)/2));
dot((-.5,-sqrt(3)/2));
[/asy]

Найдите количество упорядоченных четвёрок $(a,b,c,d)$ действительных чисел таких, что
\begin{align*}
a^4 + b^4 + c^4 + d^4 &= 48, \\
abcd &= 12.
\end{align*}

На диаграмме $K$, $O$ и $M$ являются центрами трёх полукругов. Также, $OC = 32$ и $CB = 36$.

[asy]
pair A, K, O, C, M, B, X, Y, Z, J, T;
O=(0,0);
C=(32,0);
M=(50,0);
B=(68,0);
A=(-68,0);
K=(A+C)/2;
X=(0,68);
Y=(-18,50);
Z=(50,18);
J=(7,43.3);
T=(59,15.6);
path nom, bigc, middlec, smallc;
nom=A--B--(100,100)--(-100,100)--cycle;
bigc=A..X..B--cycle;
middlec=A..Y..C--cycle;
smallc=C..Z..B--cycle;
fill(bigc, gray(.5));
fill(middlec, white);
fill(smallc, white);
draw(smallc);
draw(middlec);
draw(bigc);
draw(A--B);
label("A", A, S);
label("K", K, S);
label("O", O, S);
label("M", M, S);
label("C", C, S);
label("B", B, S);
label("S", J, SW);
label("E", T, SW);
label("$l$", (.9(J-T)+J), NW);
draw((.9(J-T)+J)--(.5(T-J)+T));
dot(K);
dot(O);
dot(M);
dot(J);
dot(T);
[/asy] Прямая $l$ проведена, касаясь меньших полукругов в точках $S$ и $E$, таким образом, что $KS$ и $ME$ обе перпендикулярны $l$. Определите площадь четырёхугольника $KSEM$.

В прямоугольнике $ABCD$ точки $F$ и $G$ лежат на $\overline{AB}$ таким образом, что $AF = FG = GB$, а $E$ — середина $\overline{DC}$. Также, $\overline{AC}$ пересекает $\overline{EF}$ в $H$ и $\overline{EG}$ в $J$. Площадь прямоугольника $ABCD$ равна 70. Найдите площадь треугольника $EHJ$.

[asy]
pair A,B,C,D,I,F,G,H,J;
A=(0,0);
B=(9,0);
C=(9,5);
D=(0,5);
F=(3,0);
G=(6,0);
I=(4.5,5);
H=(3.5,1.67);
J=(5,3.33);
draw(A--B--C--D--cycle);
draw(A--C);
draw(F--I--G);
label("$A$",A,W);
label("$B$",B,E);
label("$C$",C,E);
label("$D$",D,W);
label("$E$",I,N);
label("$F$",F,S);
label("$G$",G,S);
label("$H$",H,NW);
label("$J$",J,NE);
[/asy]

Сколько пар положительных целых чисел $(a,b)$ существует таких, что $\gcd(a,b)=1$ и
\[ \frac{a}{b}+\frac{14b}{9a}
\]является целым числом?

Функция, определённая как
\[f(x) = \left\{
\begin{array}{cl}
x + k & \text{if $x < 4$}, \\
2x - 3 & \text{if $x \ge 4$}
\end{array}
\right.\]имеет обратную, и обратная определена для всех действительных чисел. Введите все возможные значения $k,$ разделённые запятыми.

Окружность $x^2 + y^2 = 2$ и парабола $y^2 = 8x$ имеют две общие касательные, образующие четыре точки касания. Найдите площадь четырёхугольника, образованного четырьмя точками касания.

[asy]
unitsize(0.8 cm);

real upperparab (real x) {
  return (sqrt(8*x));
}

real lowerparab (real x) {
  return (-sqrt(8*x));
}

pair A, B, C, D;

A = (-1,1);
B = (2,4);
C = (-1,-1);
D = (2,-4);

draw(graph(upperparab,0,3));
draw(graph(lowerparab,0,3));
draw(Circle((0,0),sqrt(2)));
draw(interp(A,B,-0.2)--interp(A,B,1.2));
draw(interp(C,D,-0.2)--interp(C,D,1.2));
draw(A--C);
draw(B--D);

dot(A);
dot(B);
dot(C);
dot(D);
[/asy]

Для некоторых констант $a$ и $b,$ пусть \[f(x) = \left\{
\begin{array}{cl}
9 - 2x & \text{если } x \le 3, \\
ax + b & \text{если } x > 3.
\end{array}
\right.\]Функция $f$ обладает свойством, что $f(f(x)) = x$ для всех $x.$ Чему равно $a + b?$

Пусть $ABCD$ — прямоугольник. Пусть $E$ и $F$ — точки на $BC$ и $CD$, соответственно, так что площади треугольников $ABE$, $ADF$ и $CEF$ равны 8, 5 и 9, соответственно. Найдите площадь прямоугольника $ABCD$.

[asy]
unitsize(1.5 cm);

pair A, B, C, D, E, F;

A = (0,2);
B = (0,0);
C = (3,0);
D = (3,2);
E = (3*B + 2*C)/5;
F = (2*D + C)/3;

draw(A--B--C--D--cycle);
draw(A--E--F--cycle);

label("$A$", A, NW);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, NE);
label("$E$", E, S);
label("$F$", F, dir(0));
label("$8$", (A + B + E)/3);
label("$5$", (A + D + F)/3);
label("$9$", (C + E + F)/3);
[/asy]

Каждый треугольник является треугольником 30-60-90, и гипотенуза одного треугольника является длинным катетом соседнего треугольника. Гипотенуза большего треугольника равна 16 centimeters. Сколько centimeters составляет длина длинного катета меньшего треугольника?

[asy]size(150); pair O; for(int i = 2; i < 5; ++i){
draw(O--((2/sqrt(3))^i)*dir(30*i));
}
for(int g = 2; g < 4; ++g){
draw( ((2/sqrt(3))^g)*dir(30*g)-- ((2/sqrt(3))^(g+1))*dir(30*g+30));
}
label("16 cm", O--(16/9)*dir(120), W);
//label("$30^{\circ}$",.4*dir(0),dir(90));
//label("$30^{\circ}$",.4*dir(25),dir(115));
label("$30^{\circ}$",.4*dir(50),dir(140));
label("$30^{\circ}$",.4*dir(85),dir(175));
real t = (2/(sqrt(3)));
//draw(rightanglemark((1,.1),(1,0),(.9,0),s=3));
draw(rightanglemark(rotate(30)*(0,t**4),rotate(0)*(0,t**3),O,s=3));
draw(rightanglemark(rotate(0)*(0,t**3),rotate(-30)*(0,t**2),O,s=3));
//draw(rightanglemark(rotate(-30)*(0,t**2),rotate(-60)*(0,t**1),O,s=3));
[/asy]

Лист бумаги размером 8-inch на 10-inch положен поверх листа бумаги размером $8 \frac{1}{2}$-inch на 11-inch, как показано. Какова площадь области перекрытия в square inches?

[asy]draw((0,0)--(10,0)--(10,8)--(0,8)--(0,0)--cycle,linewidth(2));
draw((0,8)--(8.5,8)--(8.5,11.5)--(0,11.5)--(0,8)--cycle,linewidth(2));

draw((8.5,0)--(8.5,8),dashed);
[/asy]

В прямоугольнике $ABCD$, $AD=1$, $P$ находится на $\overline{AB}$, и $\overline{DB}$ и $\overline{DP}$ делят $\angle ADC$ на три равные части. Запишите периметр $\triangle BDP$ в простейшей форме как: $w + \frac{x \cdot \sqrt{y}}{z}$, где $w, x, y, z$ — неотрицательные целые числа. Чему равно $w + x + y + z$?

[asy]
pair A,B,C,D,P;
A=(0,5);
B=(8,5);
C=(8,0);
D=(0,0);
P=(3,5);
draw(A--B--C--D--cycle);
draw(P--D--B);
label("$A$",A,N);
label("$B$",B,N);
label("$C$",C,S);
label("$D$",D,S);
label("$P$",P,N);
[/asy]

Какова площадь в квадратных единицах четырёхугольника XYZW, показанного ниже?
[asy]
size(200); defaultpen(linewidth(0.8));
pair X = (0,0), Y = 96*dir(45), Z = (Y.x + 32, Y.y), W = (Z.x,Z.y - 24);
draw(X--Y--Z--W--cycle);
draw(rightanglemark(Y,Z,W,100));
label("$X$",X,SW); label("$Y$",Y,NW); label("$Z$",Z,NE); label("$W$",W,SE); label("96",X--Y,NW); label("104",X--W,SE); label("24",Z--W,E); label("32",Y--Z,N);
[/asy]

Пять точек $A$, $B$, $C$, $D$ и $O$ лежат на плоской поверхности. $A$ находится строго к северу от $O$, $B$ находится строго к западу от $O$, $C$ находится строго к югу от $O$, а $D$ находится строго к востоку от $O$. Расстояние между $C$ и $D$ составляет 140 m. Воздушный шар расположен в воздухе в точке $H$ строго над $O$. Шар удерживается четырьмя канатами $HA$, $HB$, $HC$ и $HD$. Канат $HC$ имеет длину 150 m, а канат $HD$ имеет длину 130 m.
[asy]
size(250);
pair A, B, C, D, O, H, W, X, Y, Z;
O=(0,0);
A=(1,1);
D=(1.5,-.3);
B=(-1.5,.3);
C=(-1,-1);
H=(0,2.5);
W=(5/3)*(A+D);
X=(5/3)*(A+B);
Y=(-1)*(W);
Z=(-1)*(X);
draw(W--X--Y--Z--W);
draw(A--C);
draw(B--D);
draw(O--H, linewidth(1));
draw(A--H, dashed);
draw(B--H, dashed);
draw(C--H, dashed);
draw(D--H, dashed);
dot(A);
dot(B);
dot(C);
dot(D);
dot(O);
dot(H);
label("A", A, NE);
label("B", B, SW);
label("C", C, SE);
label("D", D, NE);
label("O", O, SE);
label("H", H, NW);
[/asy]

Чтобы уменьшить общую длину используемых канатов, канаты $HC$ и $HD$ должны быть заменены одним канатом $HP$, где $P$ — точка на прямой линии между $C$ и $D$. (Воздушный шар остаётся в том же положении $H$ над $O$, как описано выше.) Определите наибольшую длину каната, которую можно сэкономить.

Куб с длиной ребра $s > 0$ обладает свойством, что его площадь поверхности равна сумме его объема и пятикратной длины его ребра. Вычислите сумму всех возможных значений $s$.

[asy]

size(5cm,5cm);

pair A,B,C,D,E,F,G,H;

A=(0,0);
B=(1,0);
C=(1,1);
D=(0,1);
E=(0.3,1.5);
F=C+(E-D);
G=B+(E-D);
H=A+(E-D);

draw(A--B--C--D--A--H--E);
draw(D--C--F);
draw(H--G);
draw(D--E--F--G--B);

dot(A);
dot(B);
dot(C);
dot(D);
dot(E);
dot(F);
dot(G);
dot(H);

[/asy]

На диаграмме, $D$ и $E$ являются серединами $\overline{AB}$ и $\overline{BC}$ соответственно. Определите площадь четырехугольника $DBEF$.
[asy]
size(180); defaultpen(linewidth(.7pt)+fontsize(10pt));
pair A, B, C, D, E, F;
A=(0,6);
B=(0,0);
C=(8,0);
D=(0,3);
E=(4,0);
F=(8/3,2);
draw(E--A--C--D);
draw((-1,0)--(10,0), EndArrow);
draw((0,-1)--(0,8), EndArrow);
label("$A(0,6)$", A, W);
label("$B(0,0)$", B, SW);
label("$C(8,0)$", C, S);
label("$D$", D, W);
label("$E$", E, S);
label("$F$", F, SW);
label("$x$", (10,0), dir(0));
label("$y$", (0,8), dir(90));
[/asy]

Три круговые дуги радиуса 5 единиц ограничивают показанную область. Дуги $AB$ и $AD$ являются четверть-окружностями, а дуга $BCD$ является полуокружностью. Какова площадь этой области в квадратных единицах?
[asy]
/* AMC8 2000 #19 Problem */
draw((0,0)..(1,1)..(2,0));
draw((0,0)..(.7,-.3)..(1,-1));
draw((1,-1)..(1.3, -0.3)..(2,0));
label("$A$", (1,-1), SW);
label("$B$", (0,0), W);
label("$C$", (1,1),N);
label("$D$", (2,0),E);
[/asy]

На диаграмме четыре точки имеют координаты $A(0,1)$, $B(1,3)$, $C(5,2)$ и $D(4,0)$. Какова площадь четырёхугольника $ABCD$?
[asy]
// draw axis
real low = -1; real high = 6;
draw((low, 0)--(high, 0), Arrow); draw((0, low)--(0, high - 1.5), Arrow);
label("$x$", (high, 0), E); label("$y$", (0, high - 1.5), N);

// draw quadrilateral
pair a = (0, 1); pair b = (1, 3); pair c = (5, 2); pair d = (4, 0);
draw(a--b--c--d--cycle);
label("$A$", a, W); label("$B$", b, N); label("$C$", c, E); label("$D$", d, S);
[/asy]

"Канатоходец со свободным канатом" очень похож на канатоходца, за исключением того, что канат, на котором он выступает, не натянут туго. Пол, канатоходец со свободным канатом, имеет канат, привязанный к двум столбам высотой $15\text{ m}$, которые находятся на расстоянии $14\text{ m}$ друг от друга. Когда он стоит на канате на расстоянии $5\text{ m}$ от одного из столбов, он находится на высоте $3\text{ m}$ над землей. Какова длина каната в метрах?

[asy]
draw((0,0)--(14,0)--(14,15)--(5,3)--(0,15)--cycle,black+linewidth(1));
draw((0,3)--(5,3)--(5,0),black+linewidth(1)+dashed);
draw((0,-3)--(6,-3),black+linewidth(1));
draw((8,-3)--(14,-3),black+linewidth(1));
draw((0,-3.5)--(0,-2.5),black+linewidth(1));
draw((14,-3.5)--(14,-2.5),black+linewidth(1));
draw((0,0)--(1,0)--(1,1)--(0,1)--cycle,black+linewidth(1));
draw((14,0)--(14,1)--(13,1)--(13,0)--cycle,black+linewidth(1));
draw(rotate(90)*Label("Paul"),(5,3),3N);
label("5",(0,3)--(5,3),N);
label("3",(5,0)--(5,3),E);
label("14",(7,-3));
label("15",(14,0)--(14,15),E);
[/asy]

На графике ниже каждая линия сетки соответствует одной единице. Показанная ниже линия проходит через точку $(1001,n)$ (не показанную на графике). Найдите $n$.
[asy]size(250,0);
add(shift(-10,-10)*grid(20,20));
draw((-10,0)--(10,0),linewidth(2));
draw((0,-10)--(0,10),linewidth(2));
label("x",(10,0),E);
label("y",(0,10),N);
draw((-10,-2.71) -- (10,8.71),blue,Arrows);[/asy]

Правильная шестиугольная призма имеет высоту 3 feet, и каждое ребро шестиугольных оснований составляет 6 inches. Какова сумма площадей нешестиугольных граней призмы, в square feet?

[asy]import three;

currentprojection=orthographic(1/2,-1,1/2);

draw((0,0,0)--(1,0,0)--(1.5,0.86,0)--(1,1.72,0)--(0,1.72,0)--(-0.5,0.86,0)--cycle);

draw((0,0,6)--(1,0,6)--(1.5,0.86,6)--(1,1.72,6)--(0,1.72,6)--(-0.5,0.86,6)--cycle);

draw((0,0,0)--(0,0,6));

draw((1,0,0)--(1,0,6));

draw((1.5,0.86,0)--(1.5,0.86,6));

draw((1,1.72,0)--(1,1.72,6));

draw((0,1.72,0)--(0,1.72,6));

draw((-0.5,0.86,0)--(-0.5,0.86,6));

[/asy]

$ABCDEFGH$, показанный ниже, является прямоугольным параллелепипедом. Если объем пирамиды $ABCH$ равен 20, то каков объем $ABCDEFGH$?

[asy]

import three;

triple A,B,C,D,EE,F,G,H;

A = (0,0,0);

B = (5,0,0);

C = (5,6,0);

D= (0,6,0);

EE = (0,0,4);

F = B+EE;

G = C + EE;

H = D + EE;

draw(B--C--D);

draw(B--A--D,dashed);

draw(EE--F--G--H--EE);

draw(A--EE,dashed);

draw(B--F);

draw(C--G);

draw(D--H);

label("$A$",A,S);

label("$B$",B,W);

label("$C$",C,S);

label("$D$",D,E);

label("$E$",EE,N);

label("$F$",F,W);

label("$G$",G,SW);

label("$H$",H,E);

[/asy]

На рисунке, точка $A$ является центром окружности, мера угла $RAS$ составляет 74 градуса, а мера угла $RTB$ составляет 28 градусов. Какова мера малой дуги $BR$, в градусах? [asy]
unitsize(1.2cm);
defaultpen(linewidth(.7pt)+fontsize(8pt));
dotfactor=3;

pair A=(0,0), B=(-1,0), T=(2,0);
pair T0=T+10*dir(162);
pair[] RS=intersectionpoints(Circle(A,1),T--T0);
pair Sp=RS[0];
pair R=RS[1];
pair[] dots={A,B,T,Sp,R};
dot(dots);

draw(Circle(A,1));
draw(B--T--R);

label("$T$",T,S);
label("$A$",A,S);
label("$B$",B,W);
label("$R$",R,NW);
label("$S$",Sp,NE);
[/asy]

Две параллельные хорды в окружности имеют длины 10 и 14, и расстояние между ними равно 6. Хорда, параллельная этим хордам и находящаяся посередине между ними, имеет длину $\sqrt{a}$. Найдите значение $a$.
[asy]
import olympiad; import geometry; size(100); defaultpen(linewidth(0.8));
draw(unitcircle);
draw(Label("14",align=N),dir(30)--dir(150));
draw(Label("10",align=N),dir(-40)--dir(-140));
draw(Label("$\sqrt{a}$",align=N),dir(-5)--dir(-175));
distance(rotate(90)*"6",(1,Sin(30)),(1,Sin(-40)),-9,Arrows(size=1));

[/asy]

На диаграмме $PT$ параллелен $QR.$ Какова градусная мера $\angle PQR$ в градусах?

[asy]
draw((0,0)--(10,0),black+linewidth(1));
draw((0,0)--(10,0),MidArrow);
draw((10,0)--(20,0),black+linewidth(1));
draw((0,0)--(-7,10)--(7,10)--(10,0),black+linewidth(1));
draw((-5,10)--(7,10),MidArrow);
label("$x^{\circ}$",(-6,10),SE);
label("$2x^{\circ}$",(7,10),SW);
label("$128^{\circ}$",(10,0),NE);
label("$P$",(-7,10),N);
label("$T$",(7,10),N);
label("$R$",(10,0),S);
label("$Q$",(0,0),S);
[/asy]

Всего 70 квадратов трёх размеров, вершины которых являются точками на этой прямоугольной сетке точек $3\times n$. Каково значение $n$?

[asy]

unitsize(0.4 inch);

dot((0,0),linewidth(9bp));
dot((1,0),linewidth(9bp));
dot((2,0),linewidth(9bp));
dot((0,1),linewidth(9bp));
dot((0,2),linewidth(9bp));
dot((1,1),linewidth(9bp));
dot((2,1),linewidth(9bp));
dot((1,2),linewidth(9bp));
dot((2,2),linewidth(9bp));

filldraw((2.95,-0.05)--(3.05,-0.05)--(3.05,0.05)--(2.95,0.05)--cycle,black);
filldraw((2.45,-0.05)--(2.55,-0.05)--(2.55,0.05)--(2.45,0.05)--cycle,black);
filldraw((3.45,-0.05)--(3.55,-0.05)--(3.55,0.05)--(3.45,0.05)--cycle,black);

filldraw((2.95,0.95)--(3.05,0.95)--(3.05,1.05)--(2.95,1.05)--cycle,black);
filldraw((2.45,0.95)--(2.55,0.95)--(2.55,1.05)--(2.45,1.05)--cycle,black);
